class Personnel extends React.Component{
    constructor(props) {
        super(props)
        this.state={hasError: false};
    }
    componentDidCatch(error, info) {
        // Display fallback UI
        this.setState({ hasError: true });
        console.log(error, info);
    }

    componentDidMount() {
        initializeReactGA();
    }

    render() {
        if (this.state.hasError) {
            return <ErrorPage/>
        }
        return (
            <PersonnelInfo/>
        )
    }
}

export default Personnel;
